import React, { Fragment } from 'react';

const AppMap = (props) => {
    //const {title, desc} = props.axtr;
    return (
        <Fragment>
       <div>
                   <h1>{props.axtr.id}</h1>
                    <h2>{props.title}</h2>
                     <p>{props.desc}</p>
                    </div>
        
        </Fragment>
    );
};
export default AppMap;
